import React, { Component } from 'react'
import Presentation from '../components/Presentation'
import Projects from './Projects'
import './Home.css';

class Home extends Component {

    render() {
	return (
		<div className="home">
			<Presentation />
			<Projects />
	</div>	
	)
}}

export default Home;
